"use strict";(self.webpackChunkmy_portfolio=self.webpackChunkmy_portfolio||[]).push([[445],{1462:(e,t,n)=>{n.r(t),n.d(t,{assets:()=>c,contentTitle:()=>s,default:()=>h,frontMatter:()=>a,metadata:()=>i,toc:()=>p});const i=JSON.parse('{"id":"AI Space/Research/community_posts_02222024","title":"Research Papers","description":"Graph Retrieval-Augmented Generation: A Survey","source":"@site/docs/AI Space/03-Research/community_posts_02222024.md","sourceDirName":"AI Space/03-Research","slug":"/AI Space/Research/community_posts_02222024","permalink":"/docs/AI Space/Research/community_posts_02222024","draft":false,"unlisted":false,"tags":[],"version":"current","lastUpdatedBy":"Dheeraj Inampudi","lastUpdatedAt":1724265000000,"frontMatter":{"title":"Research Papers","label":"ai","category":"ai","last_update":{"date":"08/22/2024","author":"Dheeraj Inampudi"}},"sidebar":"tutorialSidebar","previous":{"title":"RAG Intro","permalink":"/docs/AI Space/RAG/RAG_intro"},"next":{"title":"Graph Triplets","permalink":"/docs/AI Space/Graph/graph_rep"}}');var r=n(4848),o=n(8453);const a={title:"Research Papers",label:"ai",category:"ai",last_update:{date:"08/22/2024",author:"Dheeraj Inampudi"}},s=void 0,c={},p=[];function l(e){const t={a:"a",p:"p",...(0,o.R)(),...e.components};return(0,r.jsxs)(r.Fragment,{children:[(0,r.jsxs)(t.p,{children:["Graph Retrieval-Augmented Generation: A Survey\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.08921",children:"https://arxiv.org/pdf/2408.08921"}),"]","\nGraphRAG leverages structural information across entities to enable more precise and comprehensive retrieval, capturing relational knowledge and facilitating more accurate, context-aware responses. Given the novelty and potential of GraphRAG, a systematic review of current technologies is imperative. This paper provides the first comprehensive overview of GraphRAG methodologies. We formalize the GraphRAG workflow, encompassing Graph-Based Indexing, Graph-Guided Retrieval, and Graph-Enhanced Generation. We then outline the core technologies and training methods at each stage."]}),"\n",(0,r.jsxs)(t.p,{children:["VerilogCoder: Autonomous Verilog Coding Agents with Graph-based Planning and Abstract Syntax Tree (AST)-based Waveform Tracing Tool\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.08927",children:"https://arxiv.org/pdf/2408.08927"}),"]","\nVerilog is a popular hardware description language for designing and modeling digital systems; thus, Verilog generation is one of the emerging areas of research to facilitate the design process. In this work, we propose VerilogCoder, a system of multiple Artificial Intelligence (AI) agents for Verilog code generation, to autonomously write Verilog code and fix syntax and functional errors using collaborative Verilog tools (i.e., syntax checker, simulator, and waveform tracer)."]}),"\n",(0,r.jsxs)(t.p,{children:["Temporal Reversed Training for Spiking Neural Networks with Generalized Spatio-Temporal Representation\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09108",children:"https://arxiv.org/pdf/2408.09108"}),"]","\nBrain-inspired spiking neural networks (SNNs) have received widespread attention. Unlike traditional artificial neural networks (ANNs), which transfer information using intensive floating-point values, SNNs transfer discrete 0-1 spikes between neurons, providing a more efficient neuromorphic computing paradigm."]}),"\n",(0,r.jsxs)(t.p,{children:["Obtaining Optimal Spiking Neural Network in Sequence Learning via CRNN-SNN Conversion\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09403",children:"https://arxiv.org/pdf/2408.09403"}),"]","\nSpiking neural networks (SNNs) are becoming a promising alternative to conventional artificial neural networks (ANNs) due to their rich neural dynamics and the implementation of energy-efficient neuromorphic chips."]}),"\n",(0,r.jsxs)(t.p,{children:["Cognitive LLMs: Towards Integrating Cognitive Architectures and Large Language Models for Manufacturing Decision-making\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09176",children:"https://arxiv.org/pdf/2408.09176"}),"]","\nAdvancements in multi-agent LLM frameworks as well as emergent capabilities such as in-context learning have enabled LLMs to employ more sophisticated reasoning strategies, such as \u2018chain-of-thought\u2019 reasoning (CoT). We propose LLM-ACTR, which shows improved decision-making capabilities over LLMs by integrating intermediate representations extracted from a well-establish neuro-symbolic system: the ACT-R cognitive architecture."]}),"\n",(0,r.jsxs)(t.p,{children:["Neuro-Symbolic AI for Military Applications\n[this is an exception that I present a paper on military defence mechanism, because it includes explanations about the civilian possibilities offered by Neuro-Symbolic AI. Otherwise I try to keep military context out of my content]\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09224",children:"https://arxiv.org/pdf/2408.09224"}),"]","\nContributing to the growing body of research, this study represents a comprehensive exploration of the extensive possibilities offered by Neuro-Symbolic AI."]}),"\n",(0,r.jsxs)(t.p,{children:["Siamese Multiple Attention Temporal Convolution Networks for Human Mobility Signature Identification\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09230",children:"https://arxiv.org/pdf/2408.09230"}),"]","\nWe propose a Siamese Multiple Attention Temporal Convolutional Network (Siamese MA-TCN) to capitalize on the strengths of both TCN architecture and multi-head self-attention, enabling the proficient extraction of both local and long-term dependencies."]}),"\n",(0,r.jsxs)(t.p,{children:["Multi-Agent Reinforcement Learning for Autonomous Driving: A Survey\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09675",children:"https://arxiv.org/pdf/2408.09675"}),"]","\nReinforcement Learning (RL) is a potent tool for sequential decision-making and has achieved performance surpassing human capabilities across many challenging real-world tasks. As the extension of RL in the multi-agent system domain, multi-agent RL (MARL) not only need to learn the control policy but also requires consideration regarding interactions with all other agents in the environment, mutual influences among different system components, and the distribution of computational resources."]}),"\n",(0,r.jsxs)(t.p,{children:["Concept Distillation from Strong to Weak Models via Hypotheses-to-Theories Prompting\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09365",children:"https://arxiv.org/pdf/2408.09365"}),"]","\n[Microsoft hides here its automatic prompt optimization technique for enhancing weaker models on complex task]\nHand-crafting high quality prompts to optimize the performance of language models is a complicated and labor-intensive process. We propose Concept Distillation (CD), an automatic prompt optimization technique for enhancing weaker models on complex tasks."]}),"\n",(0,r.jsxs)(t.p,{children:["ELASTIC: Efficient Linear Attention for Sequential Interest Compression\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09380",children:"https://arxiv.org/pdf/2408.09380"}),"]","\nNew update on the transformer's attention mechanism. The quadratic computational and memory complexities of self attention have limited its scalability for modeling users' long range behaviour sequences. To address this problem, we propose ELASTIC, an Efficient Linear Attention for SequenTial Interest Compression, requiring only linear time complexity and decoupling model capacity from computational cost."]}),"\n",(0,r.jsxs)(t.p,{children:["Attention is a smoothed cubic spline\n[",(0,r.jsx)(t.a,{href:"https://arxiv.org/pdf/2408.09624",children:"https://arxiv.org/pdf/2408.09624"}),"]","\nThe attention module in a transformer is a smoothed cubic spline. Viewed in this manner, this mysterious but critical component of a transformer becomes a natural development of an old notion deeply entrenched in classical approximation theory."]}),"\n",(0,r.jsx)(t.p,{children:"Source: code_your_own_AI"})]})}function h(e={}){const{wrapper:t}={...(0,o.R)(),...e.components};return t?(0,r.jsx)(t,{...e,children:(0,r.jsx)(l,{...e})}):l(e)}},8453:(e,t,n)=>{n.d(t,{R:()=>a,x:()=>s});var i=n(6540);const r={},o=i.createContext(r);function a(e){const t=i.useContext(o);return i.useMemo((function(){return"function"==typeof e?e(t):{...t,...e}}),[t,e])}function s(e){let t;return t=e.disableParentContext?"function"==typeof e.components?e.components(r):e.components||r:a(e.components),i.createElement(o.Provider,{value:t},e.children)}}}]);